import React from "react";

function Note(){
    return(
        <div className="note">
            <h1>This is the note title</h1>
            <p>This is the note content</p>
        </div>
    );
};

function Cards(props){
    return(
        <div>
        <h2>{props.name}</h2>
        <input type="text" placeholder={props.placeholder} />
        </div>
    );
};

export default Note;
